import './main.css';
import MU8BitLogo from './mu_pixel_logo_8x.png';

import { ScrollIndicator } from '@src/ui/common/element/scrollIndicator';

const HomeIndexSection = props => <section className='homeIndexSection'>
  <ScrollIndicator style={{ visibility: 'hidden', }} />
  <h1 className='targetLogoPlace' {...props}>이준영 | <img width='34%' height='auto' src={MU8BitLogo} /></h1>
  <ScrollIndicator />
</section>;

export { HomeIndexSection }
